{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/sodiqsulaimon/google-data-analytics-capstone-bike-share?scriptVersionId=102376089\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"1775984a","metadata":{"_kg_hide-output":true,"papermill":{"duration":0.012808,"end_time":"2022-08-02T21:18:00.2414","exception":false,"start_time":"2022-08-02T21:18:00.228592","status":"completed"},"tags":[]},"source":["# Case Study: How Does a Bike-Share Navigate Speedy Success?\n","\n","![Cyclistic](https://drive.google.com/file/d/15HNuoexwtilOBqyemiZaXzNI47obJ6vd/view?usp=sharing)\n","\n","### Scenario\n","\n","I am a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, my team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve my recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","### Characters and teams\n","\n","*  **Cyclistic**: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n","\n","*  **Lily Moreno**: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n","* **Cyclistic marketing analytics team**: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. I joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how I, as a junior data analyst, can help Cyclistic achieve them.\n","\n","* **Cyclistic executive team**: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","### Approach\n","\n","In this case study, the six data analysis proces: **ask, prepare, process, analyze, share,** and **act** will be followed.\n"]},{"cell_type":"markdown","id":"5c9a5023","metadata":{"papermill":{"duration":0.011431,"end_time":"2022-08-02T21:18:00.26447","exception":false,"start_time":"2022-08-02T21:18:00.253039","status":"completed"},"tags":[]},"source":["## Table of Contents\n","    1. Ask\n","    2. Prepare\n","    3. Process\n","    4. Analysis of the dataset\n","        4.1 Riders distribution\n","        4.2 Average ride duration\n","        4.3 Distribution of the total monthly rides\n","        4.4 Distribution of weekly bike usage\n","        4.5 Distribution of hourly bike usage\n","        4.6 Average ride duration per hour\n","        4.7 Most popular trip start stations\n","        4.8 Most popular route\n","        4.9 Bike type used by riders\n","    5. Share\n","    6. Act\n","    Acknowledgement"]},{"cell_type":"markdown","id":"db934264","metadata":{"papermill":{"duration":0.011753,"end_time":"2022-08-02T21:18:00.287599","exception":false,"start_time":"2022-08-02T21:18:00.275846","status":"completed"},"tags":[]},"source":["# 1. **Ask**\n","\n","**The business task:** My manger, Moreno, has asked me to analyze Cyclistic historical data to find out how annual members and casual riders use Cyclistic bikes differently. The insights from my analysis would help my team to design a marketing program targeted at converting casual riders to members to drive the growth of Cyclistic. "]},{"cell_type":"markdown","id":"da813587","metadata":{"papermill":{"duration":0.011336,"end_time":"2022-08-02T21:18:00.310185","exception":false,"start_time":"2022-08-02T21:18:00.298849","status":"completed"},"tags":[]},"source":["# 2. Prepare\n","\n","A link to the data for this analysis was provided by Google as part of the case study guide for this capstone project. It was made available by Motivate International Inc. under this [license](https://ride.divvybikes.com/data-license-agreement). The data comprises of historical bike trip data from 2016 to 2022 and can be accessed [here](https://divvy-tripdata.s3.amazonaws.com/index.html)\n","\n","This data is a public data and can used to explore how different customer types are using Cyclistic bikes. The issues of privacy have been duly addressed as the users of the data have no access to riders’ personally identifiable information. This implies that I will not be be able to determine if casual riders live in the Cyclistic service area or if they have purchased multiple single passes. Other information that could be useful for the analysis such as gender and occupation of the riders can not be acessed.\n","\n","This data is reliable, original, comprehensive, current, and cited. These qualities make the data useful for this project."]},{"cell_type":"markdown","id":"ea1fd2bf","metadata":{"papermill":{"duration":0.011979,"end_time":"2022-08-02T21:18:00.334514","exception":false,"start_time":"2022-08-02T21:18:00.322535","status":"completed"},"tags":[]},"source":["# 3. Process\n","\n","I will be using R to wrangle the data. I chose R because of its flexibility in data manipulation and visualization and also because I want to be proficient in using R for exploratory data analysis.\n","\n","The cleaning and manipulation steps will be documented using this R notebook. I will be using the trip data from January 2021 to December 2021. Though there are newer data (2022), I chose 2021 data to run my analysis on a complete year."]},{"cell_type":"markdown","id":"6f0e165a","metadata":{"papermill":{"duration":0.011469,"end_time":"2022-08-02T21:18:00.357986","exception":false,"start_time":"2022-08-02T21:18:00.346517","status":"completed"},"tags":[]},"source":["## 3.1 Load packages\n","Let's start by loading the required packages for this analysis"]},{"cell_type":"code","execution_count":1,"id":"af0b1fb8","metadata":{"execution":{"iopub.execute_input":"2022-08-02T21:18:00.386846Z","iopub.status.busy":"2022-08-02T21:18:00.384238Z","iopub.status.idle":"2022-08-02T21:18:01.782143Z","shell.execute_reply":"2022-08-02T21:18:01.780376Z"},"papermill":{"duration":1.415474,"end_time":"2022-08-02T21:18:01.784665","exception":false,"start_time":"2022-08-02T21:18:00.369191","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[